// given a integer array, find the length of its longest harmonous subsequence
// harmonous sequence is an array where its maximum and minimum value is exactly 1
// the length of input array  <= 20,000
#include <vector>
#include <iostream>
#include <map> // here must use ordered map to keep the key consecutive
#include <utility> // pair
using namespace std;
// TLE!!!
class Solution {
public:
    int findLHS(vector<int>& nums) {
        int len = nums.size();
        if(len <= 1) return 0;
        // <num, #elem in the harm seq composed of {num, num+1}>
        map<int, int> mp;
        for(int i:nums) 
        {   // (i, i+1) seq
            ++mp[i];
        }
        int res = 0;
        int prevnum = ~(1 << 31);
        int prevcnt = 0;
        for(pair<int, int> it: mp)
        {
            if(it.first == prevnum + 1)
            {
                res = max(res, it.second + prevcnt);
            }
            prevnum = it.first;
            prevcnt = it.second;
            /*
            if(find(nums.begin(), nums.end(), it->first) != nums.end() && find(nums.begin(), nums.end(), it->first+1) != nums.end())
                res = max(res, it->second);*/
        }
        return res;
    }
};

